import React, { useEffect, useState } from 'react';
import axios from 'axios';
axios.defaults.baseURL = "http://localhost:8081";

function ListView() {
  const [cars, setCars] = useState([]);
  const [isEditing, setIsEditing] = useState(false);
  const [currentCar, setCurrentCar] = useState(null);

  useEffect(() => {
    // Fetch all cars from the backend
    axios.get('/api/cars')
      .then(response => {
        setCars(response.data);
      })
      .catch(error => {
        console.error('There was an error fetching the cars!', error);
      });
  }, []);

  const handleDelete = (carId) => {
    const confirmDelete = window.confirm("Are you sure you want to delete this car?");
    if (confirmDelete) {
      axios.delete(`/api/cars/${carId}`)
        .then(response => {
          setCars(cars.filter(car => car.id !== carId));  // Remove the deleted car from the state
          alert("Car deleted successfully");
        })
        .catch(error => {
          console.error("Error deleting car:", error);
          alert("Error deleting car");
        });
    }
  };

  const handleEdit = (car) => {
    setIsEditing(true);
    setCurrentCar(car);
  };

  const handleUpdate = () => {
    if (currentCar) {
      axios.put(`/api/cars/${currentCar.id}`, currentCar)
        .then(response => {
          const updatedCars = cars.map(car => (car.id === currentCar.id ? response.data : car));
          setCars(updatedCars);
          setIsEditing(false);
          setCurrentCar(null);
          alert("Car updated successfully");
        })
        .catch(error => {
          console.error("Error updating car:", error);
          alert("Error updating car");
        });
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setCurrentCar(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  return (
    <div>
      <h1>Car List</h1>
      {isEditing ? (
        <div>
          <h2>Update Car</h2>
          <form onSubmit={(e) => e.preventDefault()}>
            <label>
              Name:
              <input
                type="text"
                name="name"
                value={currentCar.name}
                onChange={handleChange}
              />
            </label>
            <br />
            <label>
              Model:
              <input
                type="text"
                name="model"
                value={currentCar.model}
                onChange={handleChange}
              />
            </label>
            <br />
            <label>
              Basic Amount:
              <input
                type="number"
                name="basicAmount"
                value={currentCar.basicAmount}
                onChange={handleChange}
              />
            </label>
            <br />
            <label>
              Tax Amount:
              <input
                type="number"
                name="tax"
                value={currentCar.tax}
                onChange={handleChange}
              />
            </label>
            <br />
            <label>
              Max Amount:
              <input
                type="number"
                name="maxAmount"
                value={currentCar.maxAmount}
                onChange={handleChange}
              />
            </label>
            <br />
            <button type="button" onClick={handleUpdate}>Update Car</button>
            <button type="button" onClick={() => { setIsEditing(false); setCurrentCar(null); }}>Cancel</button>
          </form>
        </div>
      ) : (
        <table>
          <thead>
            <tr>
                <th>Id</th>
              <th>Name</th>
              <th>Model</th>
              <th>Basic Amount</th>
              <th>Tax Amount</th>
              <th>Max Amount</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {cars.map((car, index) => (
              <tr key={car.id}>
                <td>{car.id}</td>
                <td>{car.name}</td>
                <td>{car.model}</td>
                <td>{car.basicAmount}</td>
                <td>{car.tax}</td>
                <td>{car.maxAmount}</td>
                <td>
                  <button onClick={() => handleEdit(car)}>Update</button>
                  <button onClick={() => handleDelete(car.id)}>Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default ListView;
